(19,	'&lt;p&gt;\r\n	测试17测试17测试17\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;img src=&quot;/v8/Uploads/2016-01-04/568a3fb7b5599.jpg&quot; alt=&quot;&quot; /&gt;\r\n&lt;/p&gt;'),
(20,	'&lt;p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10834/2416708607&quot; img_width=&quot;454&quot; img_height=&quot;202&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		《阿凡提的故事》系列片，上海美影厂1979-1988年摄制。。。。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10828/8383457223&quot; img_width=&quot;456&quot; img_height=&quot;207&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		中国最优秀的动画片彩色动画电影《大闹天宫》由上海美术电影制片厂拍摄，被称为中国动画史上的一座壮美丰碑。。。。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10830/8442520186&quot; img_width=&quot;389&quot; img_height=&quot;300&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		“儿子的头大，手儿小，爸爸的头小，手儿很大，大手牵小手，走路不怕滑，走呀走呀，走走走走，转眼儿子就长大……”可最后都没看到大头儿子长大……\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p2.pstatp.com/large/10829/8448677732&quot; img_width=&quot;479&quot; img_height=&quot;572&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		小时候cctv每天下午5;30就放动画城，然后就看这部一年四季都穿短裤的海尔兄弟。。。。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10833/5489010092&quot; img_width=&quot;318&quot; img_height=&quot;202&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		本片于1988年获广播电影电视部1986—1987年优秀影片奖,其中第一集曾于1985年获首届中国儿童少年电影童牛奖优秀影片奖,第四集获首届中国儿童少年电影油娃奖优秀影片奖。。。。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10831/5977179562&quot; img_width=&quot;458&quot; img_height=&quot;218&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		“葫芦娃，葫芦娃，七个葫芦一朵花。风吹雨打，都不怕，啦啦啦啦。叮叮当当咚咚当当，葫芦娃，叮叮当当咚咚当当，本领大，啦啦啦啦。葫芦娃，葫芦娃，本领大。”\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10828/8404447733&quot; img_width=&quot;400&quot; img_height=&quot;314&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		“小邋遢，真呀真邋遢，邋遢大王就是他，人人叫他小邋遢……”这首歌一响起，估计很多人都会心潮澎湃，那时候的小孩子没有多少不会唱这首歌。。。。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10833/5493843938&quot; img_width=&quot;397&quot; img_height=&quot;218&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		“小小老鼠小小老鼠不偷米，叽哩哩哩叽哩哩哩叽哩哩哩;大脸猫大脸猫爱吃鱼，喵咪咪喵咪咪喵咪咪”印象最深的一集是蓝皮鼠和大脸猫拥有了一辆巧克力做的汽车，羡慕啊~\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p2.pstatp.com/large/10828/8407475520&quot; img_width=&quot;318&quot; img_height=&quot;392&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		有两个孩子,一个叫&quot;没头脑&quot;,做起事来丢三拉四,总要出点差错；一个叫&quot;不高兴&quot;,老是别别扭扭,和别人唱反调，影片导演让他们变成了大人。。。。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10831/5983534325&quot; img_width=&quot;349&quot; img_height=&quot;228&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		《小糊涂神》，金糊涂银糊涂比不上咱家的老糊涂，金糊涂银糊涂比不上咱家的老老糊涂……\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10828/8410183116&quot; img_width=&quot;459&quot; img_height=&quot;213&quot; alt=&quot;用这些动画片来纪念我们那终将逝去的童年~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		《哪吒闹海》上海美术电影制片厂1979年出品。。。。\r\n	&lt;/p&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;'),
(21,	'&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10797/8026374152&quot; img_width=&quot;568&quot; img_height=&quot;396&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		在花费了三万多美元、经历了20次失败人工受孕后，来自美国加州的Jennifer和Steve夫妇转向了著名的印度代孕工厂寻求帮助。图为印度坎克斯哈代孕中心，Jennifer穿过9000公里来到印度，第一次见到了她的孩子Kyle，并拥抱代孕印度母亲Manisha\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10798/7704248158&quot; img_width=&quot;585&quot; img_height=&quot;366&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		Jennifer夫妇俩称，这是一种“双赢”的做法。一方面，印度代孕母亲可以获得比其劳作终生都多的酬金；另一方面，不孕夫妇能得到一个有着他们DNA的孩子。图为做完剖腹产手术后的三天，Manisha都没有胃口。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10803/904459502&quot; img_width=&quot;585&quot; img_height=&quot;374&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		坎克斯哈代孕中心里，正在康复的Manisha忍受着手术后的阵痛。这所位于印度阿南德(Anand)市中心的阿坎克斯哈不孕不育医院，每年都接待数百名来自世界各地的客户。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10798/7709410907&quot; img_width=&quot;580&quot; img_height=&quot;362&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		Kyle出生四天后，Jennifer将Kyle介绍给他的代孕母亲Manisha及她的孩子们。Kyle是这家代孕中心出生的第649个孩子\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p3.pstatp.com/large/10801/5023418365&quot; img_width=&quot;587&quot; img_height=&quot;402&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		Manisha和丈夫孩子一起准备离开代孕中心。Manisha丈夫的月收入低于50美元。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10801/5024818520&quot; img_width=&quot;538&quot; img_height=&quot;395&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		生产后第11天，Manisha就开始打扫刚刚用代孕挣来的7500美元翻新过的家。Manisha起初对“出卖”自己的身体倍感羞耻，但代孕的酬劳能极大改善家人的生活窘境。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p1.pstatp.com/large/10803/930088024&quot; img_width=&quot;564&quot; img_height=&quot;373&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		Manisha家中裸露在外的电灯。代孕母亲至少能获得7500美元的收入，如果生出双胞胎还能获得1500至2000元的奖金。\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		&lt;img src=&quot;http://p2.pstatp.com/large/10801/5027012687&quot; img_width=&quot;596&quot; img_height=&quot;393&quot; alt=&quot;揭秘印度代孕工厂：其实每个代孕妈妈都有逼不得已的苦衷~~&quot; style=&quot;margin:1em auto;padding:0px;font-family:inherit;font-size:inherit;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;vertical-align:baseline;max-width:100%;display:block;border-top-left-radius:4px;border-top-right-radius:4px;border-bottom-right-radius:4px;border-bottom-left-radius:4px;&quot; /&gt;\r\n	&lt;/p&gt;\r\n	&lt;p style=&quot;margin-top:1em;margin-bottom:0px;padding:0px;border:0px;font-family:helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun;font-size:18px;line-height:27px;vertical-align:baseline;color:#5D5D5D;white-space:normal;background-color:#FFFFFF;&quot;&gt;\r\n		印度，工人们正在建造一座新的、面积达3万平方米的坎克斯哈代孕中心。\r\n	&lt;/p&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;'),
