  `type` tinyint(1) NOT NULL COMMENT '1微信2qq3微博',
  `unionid` varchar(32) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `dux_pay_log`;
CREATE TABLE `dux_pay_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fee` float(10,2) NOT NULL,
  `desc` varchar(255) NOT NULL,
  `yxq` varchar(55) NOT NULL,
  `out_trade_no` varchar(55) NOT NULL,
  `ewmurl` varchar(55) NOT NULL,
  `time` int(11) NOT NULL,
  `status` tinyint(4) NOT NULL COMMENT '1成功2审核0失败4超时',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `dux_position`;
CREATE TABLE `dux_position` (
  `position_id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `sequence` int(10) DEFAULT '0',
  PRIMARY KEY (`position_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='推荐位';


DROP TABLE IF EXISTS `dux_prove`;
CREATE TABLE `dux_prove` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL COMMENT '用户id',
  `account` varchar(50) NOT NULL COMMENT '账户名',
  `bcard` varchar(100) NOT NULL COMMENT '银行卡',
  `bxid` int(11) NOT NULL COMMENT '保险公司id',
  `create_time` int(11) NOT NULL,
  `status` int(11) NOT NULL COMMENT '1：通过 2未验证 3：未通过',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='审核表';


DROP TABLE IF EXISTS `dux_province`;
CREATE TABLE `dux_province` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='省市地区表';


DROP TABLE IF EXISTS `dux_sj_log`;
CREATE TABLE `dux_sj_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `aid` int(11) NOT NULL COMMENT '文章id',
  `uid` int(11) NOT NULL COMMENT '用户id',
  `time` varchar(220) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `aid` (`aid`,`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `dux_tags`;
CREATE TABLE `dux_tags` (
  `tag_id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `click` int(10) DEFAULT '1',
  `quote` int(10) DEFAULT '1',
  PRIMARY KEY (`tag_id`),
  KEY `quote` (`quote`),
  KEY `click` (`click`),
  KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='TAG标签';


DROP TABLE IF EXISTS `dux_tags_has`;
CREATE TABLE `dux_tags_has` (
  `content_id` int(10) DEFAULT NULL,
  `tag_id` int(10) DEFAULT NULL,
  KEY `aid` (`content_id`),
  KEY `tid` (`tag_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='TAG关系';


DROP TABLE IF EXISTS `dux_users`;
CREATE TABLE `dux_users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_login` varchar(60) NOT NULL DEFAULT '' COMMENT '用户名',
  `user_pass` varchar(64) NOT NULL DEFAULT '' COMMENT '登录密码；sp_password加密',
  `user_nicename` varchar(50) NOT NULL DEFAULT '' COMMENT '用户美名',
  `avatar` varchar(255) NOT NULL,
  `user_email` varchar(100) NOT NULL DEFAULT '' COMMENT '登录邮箱',
  `last_login_ip` varchar(16) NOT NULL COMMENT '最后登录ip',
  `last_login_time` int(11) NOT NULL COMMENT '最后登录时间',
  `create_time` int(11) NOT NULL COMMENT '注册时间',
  `regip` varchar(22) NOT NULL,
  `user_status` int(11) NOT NULL DEFAULT '1' COMMENT '用户状态 0：禁用； 1：正常 ；2：未验证',
  `user_type` smallint(1) DEFAULT NULL COMMENT '用户类型，1:投保招标人 ;2:业务员;3：保险公司保险顾问',
  `user_code` varchar(100) NOT NULL COMMENT '身份证',
  `user_qq` int(11) NOT NULL,
  `user_tel` varchar(50) NOT NULL,
  `weixin` varchar(32) NOT NULL COMMENT '微信号',
  `unionid` varchar(32) NOT NULL,
  `user_proid` int(11) NOT NULL COMMENT '省地区id',
  `user_cityid` int(11) NOT NULL COMMENT '所在市id',
  `occupation` varchar(100) NOT NULL COMMENT '职业',
  `parent_id` int(11) NOT NULL COMMENT '父id',
  `subscribe` tinyint(4) NOT NULL COMMENT '是否已关注',
  `sex` tinyint(4) DEFAULT NULL,
  `country` varchar(22) DEFAULT NULL,
  `province` varchar(22) DEFAULT NULL,
  `city` varchar(22) DEFAULT NULL,
  `subscribe_time` int(11) DEFAULT NULL,
  `jifen` int(11) NOT NULL COMMENT '积分',
  `money` decimal(10,2) NOT NULL,
  `wbfee` decimal(10,2) NOT NULL COMMENT '微币',
  `historymoney` decimal(10,2) NOT NULL,
  `b_pro` varchar(20) NOT NULL,
  `b_city` varchar(20) NOT NULL,
  `b_fws` varchar(20) NOT NULL,
  `historywb` decimal(10,2) DEFAULT '0.00' COMMENT '支出微币统计',
  `wsfxnum` int(11) NOT NULL DEFAULT '0' COMMENT '微商文章被分享数',
  `wsrenum` int(11) NOT NULL DEFAULT '0' COMMENT '微商文章被浏览数',
  `user_rank` smallint(1) NOT NULL DEFAULT '0',
  `taskmoney` decimal(10,2) NOT NULL COMMENT '任务累计收益',
  `fansmoney` decimal(10,2) NOT NULL COMMENT '粉丝收益',
  `is_parent_award` smallint(2) NOT NULL DEFAULT '0' COMMENT '0:未领取1：已领取',
  PRIMARY KEY (`id`),
  KEY `user_login_key` (`user_login`),
  KEY `weixin` (`weixin`),
  KEY `parent_id` (`parent_id`),
  KEY `IDX_SUBSCRIBE_HISTORYMONEY` (`subscribe`,`historymoney`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `dux_user_bind`;
